import todos from './todosReducers'
import filtered from './filterReducer'
import { createSlice } from '@reduxjs/toolkit'

export const rootSlicer = createSlice({
  name: 'rootReduce',
  initialState: localStorage.getItem(todos),
  reducers: {
    todos,
    filtered
  }

})
